import { Route, BrowserRouter as Router , Routes  } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import MainContent from './components/MainContent';

function App() {
  return (

      <div className="App">
        <Router>
          <Header/>
          <Routes>  
          <Route path='/' element={<MainContent/>} />
          </Routes>
          </Router>
      </div>
  );
}

export default App;
